import { StatusBar } from 'expo-status-bar';
import React, { useState, useEffect } from "react";
import { StyleSheet, Text, View } from 'react-native';
import socketIOClient from "socket.io-client";
const ENDPOINT = "http://192.168.8.146:3000";

export default function App() {
    const [response, setResponse] = useState("");
    useEffect(() => {
      const socket = socketIOClient(ENDPOINT);
      socket.on("centerTextContent", data => {
        setResponse(data.newCurrentTime);
      });
    }, []);
  return (
    <View style={styles.container}>
      <Text>It's My first app and i dont know much about it {response} What happens here if I type after VARIBE?</Text>
      <StatusBar style="auto" />
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
    alignItems: 'center',
    justifyContent: 'center',
  },
});
